import React from "react";

// SVG components

import Plus from "../assets/icon_menu/Plus.jsx";
import Star from "../assets/icon_menu/Star.jsx";
import Cart from "../assets/Cart.jsx";
import ArrowNext from "../assets/ArrowNext.jsx";
import ArrowPrev from "../assets/ArrowPrev.jsx";
import User from "../assets/User.jsx";
import DoubleArrowNext from "../assets/DoubleArrowNext.jsx";
import DoubleArrowPrev from "../assets/DoubleArrowPrev";
import Remove from "../assets/Remove.jsx";

const style = {
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
};

const ImageSvg = ({ config }) => {
  const svg_collections = {


    User,

  };

  const ImageCofig = {
    fill: config.fill ? config.fill : "none",
    stroke: config.stroke ? config.stroke : "black",
    size: config.size ? config.size : 30,
  };

  const Icon = svg_collections[config.icon];

  return (
    <span style={config.style ? style : null}>
      <Icon
        fill={ImageCofig.fill}
        stroke={ImageCofig.stroke}
        size={ImageCofig.size}
      />
    </span>
  );
};

export default ImageSvg;
